import ava from '../images/profile/ava.jpg';
import editButton from '../images/profile/edit-btn-icon.svg';

function Main() {
  const handleEditAvatarClick = () => {
    console.log('clicked avatar');
  }

  const handleEditProfileClick = () => {
    console.log('clicked profile');
  }

  const handleAddPlaceClick = () => {
    console.log('clicked new place');
  }

  return (
      <main>
        <section className="profile">
          <div className="profile__content">
            <div className="profile__avatar-container">
              <img src={ava} alt="Аватар" className="profile__avatar"/>
            <div className="profile__avatar-overlay">
              <img onClick={handleEditAvatarClick} src={editButton} alt="Редактировать" className="profile__avatar-edit"/>
            </div>
          </div>
          <div className="profile__info">
            <div className="profile__info-main">
              <h1 className="profile__info-name"> Жак</h1>
              <button onClick={handleEditProfileClick} aria-label="Редактироавние профиля" type="button" className="profile__info-edit">
              </button>
            </div>
            <p className="profile__info-job">Пьяница</p>
          </div>
        </div>
        <button onClick={handleAddPlaceClick} aria-label="Добавить" type="button" className="profile__add-btn">
        </button>
      </section>
      <section className="elements">
      </section>
      </main>
  );
}

export default Main;
